ISLAMABAD, Oct 16 (APP):Irfan Siddiqui, the parliamentary leader of the Pakistan Muslim League-Nawaz (PML-N) in the Senate, has summoned a meeting of the party’s parliamentary group on Thursday at 2:30 PM.
He urged all party senators to ensure their attendance in Islamabad.
